import { Button } from "@chakra-ui/button";
import { Flex, Text } from "@chakra-ui/layout";
import { Link } from "react-router-dom";

export default function Nav() {
  return (
    <Flex
      p="30px"
      background="#FFFFFF"
      alignItems="center"
      justifyContent="flex-end"
      w="100%"
      m="0 auto"
      maxW="1367px"
    >
     <Text 
     justifyContent="flex-start"
      color="#FDC921" 
      ml="10px"
      fontSize="22px"
      fontWeight="900"
      >
      GoTokens
      </Text>
     
    </Flex>
  );
}
